Pyarey Afzal ( English: Dear Afzal) is a Pakistani romantic drama serial that aired on ARY Digital, directed by Nadeem Baig and written by Khalil-ur-Rehman Qamar. This drama was first aired on 26 November 2013 starring Hamza Ali Abbasi, Aiza Khan,Saba Hameed, Firdous Jamal, Sana Javed, Saba Faisal, Anoushey Abbasi and Sheryar Zaidi.[1]
